import React from "react";

const NavBar = (props) => {

    return(
        <header>
            <h1>
            {props.title}
            </h1>
             <div>
                <a>{props.authenticate}</a>
                <a>{props.events}</a>
                <a>{props.bookings}</a>
             </div>
        </header>
    )
};

export default NavBar;
